export default function Nav() {
  return (
    <nav className='bg-slate-400 text-lime-300'>
      <div id='logo'>Logo</div>
      <div id='nav-links-container'>
        <ul className='flex-row'>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </div>
    </nav>
  )
}
